  false,\n\t\"url\": null,\n\t\"notes\": \"This report summarizes the Waterfowl Production
  and Habitat Survey for northern Manitoba, northern Saskatchewan, and the Saskatchewan
  River Delta during 1997. The primary purpose of the survey is to provide information
  on duck production from the mid-continent breeding areas. Survey methods, weather
  and habitat conditions, production indices, and tables of waterfowl brood and late-nesting
  indices are provided.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
